import Layout from '../components/Layout';
import ContactForm from '../components/form/ContactForm';

const Contact = () => {
	return (
		<Layout>
            <div className="container">
                <div className="mx-auto my-5">
                    <ContactForm />
                </div>
            </div>
        </Layout>
	);
};

export default Contact;
